/** Roll current time leaf member to next leafoffset for time dimension
*/
define('o9.memberupdate.rollcurrenttime', ['o9/data/query', 'o9/data/cellset'], function () {

    var currentTimeRollingForward = function (o9Params) {
        var parsedParams = JSON.parse(o9Params);
        var timeDimensionName = parsedParams.TimeDimensionName;
        Log.Info("Executing Roll-Current-Time..." + parsedParams);
        Log.Info('Roll-Current-Time: Time Dimension Name: ' + timeDimensionName);
        var timeDimMetaQuery = 'select ' +
            '(_SchemaDimension.[_Dimension].[' + timeDimensionName + '].[_Attribute]) on row, ' +
            '() on column include memberproperties {[_SchemaDimension].[_Attribute],TopologicalSortOrder} ;';
        
        var queryModule = require('o9/data/query');
        var cellsetModule = require('o9/data/cellset');
        var timeDimMeta = cellsetModule.createCellSet(queryModule.select(timeDimMetaQuery));
        var timeAttributeMembers = timeDimMeta.attributeMembers('_SchemaDimension', '_Attribute');
        
        timeAttributeMembers.sort(function (item1, item2) {
            return item1.MemberProperties[0].PropertyValue - item2.MemberProperties[0].PropertyValue;
        });
        //of the form [dimension name].[attribute name]
        var timeLeafAttributeName = timeAttributeMembers[0].Name;
                
        //1. update the current leaf as false
        //2. update the offset member as current
        
        var memberQuery = 'select (' +
            timeLeafAttributeName + '.Filter(#.['+ getAttributeName(timeLeafAttributeName) +'$IsCurrent] == true || ' +
            '#.Name == ' + timeLeafAttributeName + '.Filter(#.['+ getAttributeName(timeLeafAttributeName) +'$IsCurrent] == true).Element(0).LeadOffset(1).Name)) on row,' +
            '() on column ;';
        var memberQueryData = queryModule.select(memberQuery);
        //if no current member, pick the first element
        if (memberQueryData.Meta.length === 0) {
            memberQuery = 'select (' + timeLeafAttributeName + '.element(0)) on row, () on column;';
            memberQueryData = queryModule.select(memberQuery);
        }
        var members = cellsetModule.createCellSet(memberQueryData).attributeMembers(timeDimensionName, getAttributeName(timeLeafAttributeName));
        var updatequery = 'block begin ';
        var logMsg = '';
        //query
        if (members.length === 1) {
            updatequery += 'UPDATEMEMBER(' + timeLeafAttributeName + '={todatetime("' + members[0].Key + '"),"' +
                members[0].Name + '"}, ' + timeDimensionName + '.['+ getAttributeName(timeLeafAttributeName) +'$IsCurrent]={"true",}); ';				
            logMsg = members[0].Name;
        }
        else if (members.length === 2) {
            
            var offsetCell = members[1];

            updatequery += 'UPDATEMEMBER(' + timeLeafAttributeName + '={todatetime("' + offsetCell.Key + '"),"' +
                offsetCell.Name + '"}, ' + timeDimensionName + '.['+ getAttributeName(timeLeafAttributeName) +'$IsCurrent]={"true",}); ';
            logMsg = offsetCell.Name;
        }
        
        updatequery += ' end;';
        //update current time
        queryModule.update(updatequery);
        Log.Info('Roll-Current-Time: Complete. Current Member:' + logMsg);
        return offsetCell;
    };

    //function to get the attributename. From string of format [dimension1].[attribute1], should return 'attribute1'
    function getAttributeName(metaAttName) {
        return metaAttName.split('.')[1].replace('[', '').replace(']', '');
    }

    return {
        currentTimeRollingForward: currentTimeRollingForward
    };
});

